import react from "react";
import images from "./FoodImages/index"
console.log(images)

const FoodContext = react.createContext({
  FoodData: [],
  FoodImg: []
});

const FoodData = {
  "1001" : {
    row: 1,
    name: "Devil Fried Chicken",
    price: 5.99,
    Description: "Taste the individual Devil Fried Chicken",
  },

  //Method to fi the object by its row
  filterByRow : (row) => {} 
}

let FoodImg = {}

FoodData.forEach((food,index) => {
  FoodImg[food.id] = images[`${food.id}`]
})



export const FoodContextProvider = (props) => {
  return <FoodContext.Provider value={{
    FoodData: FoodData,
    FoodImg:FoodImg
  }}></FoodContext.Provider>;
};

export default FoodContext;
